INSERT INTO `posts` (`id`, `content`, `date`, `title`, `author_id`, `page_id`) VALUES(1, '<p><span style=\"color: rgb(68, 68, 68); font-family: arial, sans-serif; font-size: 12.8013px;\">Z okazji przypadającego 14 października Dnia Edukacji Narodowej Samorząd Uczniowski przygotował w naszej szkole uroczystą akademię. Uczniowie rozpoczęli od wesołej piosenki a następnie zaprezentowali żartobliwe wierszyki o nauczycielach i pozostałych pracownikach szkoły. Na koniec wszyscy pracownicy szkoły otrzymali drobne upominki przygotowane przez SU.</span></p><p><span style=\"color: rgb(68, 68, 68); font-family: arial, sans-serif; font-size: 12.8013px;\"><br></span></p><p><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"school.jpg\" style=\"font-size: 1rem; width: 474.4px; height: 316.662px;\"></div><br></p>', '2021/02/12 23:32', 'Dzień nauczyciela', 54, 4);
INSERT INTO `posts` (`id`, `content`, `date`, `title`, `author_id`, `page_id`) VALUES(2, '<p><span style=\"color: rgb(68, 68, 68); font-family: arial, sans-serif; font-size: 12.8013px;\">Szkolne Koło PCK zorganizowało zbiórkę rzeczy dla schroniska psów i kotów w Oświęcimiu. Wszystkim ofiarodawcom dziękujemy za dobre serce. Podziękowanie od schroniska jest szczególnie dla nas ważne. Cieszymy się, że chociaż trochę mogliśmy umilić życie czworonożnym pupilom.</span></p><p><span style=\"color: rgb(68, 68, 68); font-family: arial, sans-serif; font-size: 12.8013px;\"><br></span></p><p><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"images.jfif\" style=\"font-size: 1rem; width: 259px;\"></div><br></p>', '2021/02/12 23:35', 'Światowy Dzień Zwierząt', 54, 4);
INSERT INTO `posts` (`id`, `content`, `date`, `title`, `author_id`, `page_id`) VALUES(3, '<p><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-family: arial, sans-serif; font-size: 12.8013px; color: rgb(0, 0, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 18px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Przewodnicząca&nbsp;samorządu- Horacy Zgórski<br>zastępca- Aleksandra Nowak<br>skarbnik&nbsp;- Darek Stanek</strong></span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 18px;\"><br><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">sekretarz- Lucyna Lasek<br>członek Urszula Komendera<br><br>Opiekun&nbsp;Samorządu Uczniowskiego-&nbsp;pani Beata Nowak.</strong></span></span><br style=\"color: rgb(68, 68, 68); font-family: arial, sans-serif; font-size: 12.8013px;\"></p>', '2021/02/12 23:38', 'Skład samorządu', 54, 6);
INSERT INTO `posts` (`id`, `content`, `date`, `title`, `author_id`, `page_id`) VALUES(4, '<ol style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 12px; padding: 0px 0px 0px 12px; border: 0px; outline: 0px; vertical-align: baseline; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 12.8013px; line-height: 1.5em; overflow-wrap: break-word; color: rgb(68, 68, 68); font-family: arial, sans-serif;\"><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Obchody Dnia Chłopca -</strong>- organizacja konkursu na Super chłopaka szkoły wśród uczniów klas II, IV - VIII.</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Wieczór filmowy</strong>- zorganizowanie comiesięcznych seansów filmowych.</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Obchody Dnia Komisji Edukacji Narodowej -&nbsp;</strong>przygotowanie programu artystycznego oraz&nbsp; przygotowanie gazetki okolicznościowej.</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"></span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Zorganizowanie skrzynki kontaktowej</strong>&nbsp;dla uczniów umożliwiającej anonimowe zgłaszanie problemów.</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Święto Wszystkich Świętych i Zaduszki-&nbsp;&nbsp;</strong><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\">wykonanie gazetki okolicznościowej.</span></span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Święto Niepodległości-&nbsp;</strong></span>wykonanie gazetki okolicznościowej</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Dzieci mają swoje prawa&nbsp;</b>&nbsp;- wykonanie gazetki okolicznościowej&nbsp;oraz przeprowadzenie ankiety wśród uczniów.</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Andrzejki-&nbsp;</strong>organizacja dyskoteki dla wszystkich klas i przygotowanie salonu wróżb.</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"></span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Boże Narodzenie -</strong></span>wykonanie gazetki&nbsp; okolicznościowej, konkurs na najpiękniejszą bombkę choinkową.</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Karnawał-</strong>&nbsp;wykonanie gazetki, organizacja dyskoteki&nbsp; karnawałowej z lizakowym koncertem życzeń.</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Walentynki – święto zakochanych-&nbsp;</strong>przygotowanie okolicznościowej gazetki, poczta walentynkowa.</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Międzynarodowy Dzień Kobiet -</strong>przygotowanie okolicznościowej akademii, wybór najsympatyczniejszej dziewczyny szkoły klas IV-VIII.</span><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"></span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Wielkanoc- tradycje i zwyczaje -</strong><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\">wykonanie gazetki&nbsp; okolicznościowej, organizacja konkursu na najciekawszą i najpiękniejszą kartkę wielkanocną lub pisankę.</span></span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Święta Majowe-</strong>wykonanie gazetki&nbsp; okolicznościowej.</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Światowy Dzień Dziecka-&nbsp;</strong>wykonanie gazetki, współorganizacja konkursów i zabaw sportowych.</span></p></li><li style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent;\"><p style=\"margin-right: 0px; margin-bottom: 1.5em; margin-left: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 1em; line-height: 1.5em; overflow-wrap: break-word;\"><span style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-size: 16px;\"><strong style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">Bezpieczne Wakacje-&nbsp;</strong>wykonanie gazetki okolicznościowej, organizacja konkursu na najciekawszy plakat promujący bezpieczne wakacje.</span></p></li></ol>', '2021/02/12 23:39', 'Zadania, które realizujemy w roku szkolnym 2020/2021', 54, 6);
