INSERT INTO `posts` (`id`, `content`, `date`, `title`, `author_id`, `page_id`) VALUES(7, '<p><img src=\"data:image/png;base64,\" data-filename=\"image.png\" style=\"width: 341.6px;\"></p><p><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\">5</font></font><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\">&nbsp;X 2018r<b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">.&nbsp;</b>odbyły się zajęcia warsztatowe dla przedszkolaków dotyczące zanieczyszczenia &nbsp;i ochrony powietrza „Czyste powietrze dla każdego”, w ramach akcji przekazania oczyszczaczy powietrza do przedszkoli z terenu województwa małopolskiego.</font></font><br style=\"color: rgb(68, 68, 68); font-family: arial, sans-serif; font-size: 12.8013px;\"><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\">Warsztaty obejmowały:</font></font><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\"><b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\"><br>Część I-&nbsp;</b></font></font><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\">Wprowadzenie- zapoznanie się z maskotką Panem Wicherkiem.</font></font><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\"><b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\"><br>Część II- Doświadczenia</b></font></font><span style=\"color: rgb(68, 68, 68); font-family: arial, sans-serif; font-size: 12.8013px;\">&nbsp;</span><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\">wyjaśniające dzieciom, co to jest powietrze i jakie są jego właściwości</font></font><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\"><b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\">:&nbsp;</b></font></font><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\">istnienie powietrza w przedmiotach (materia nieożywiona),&nbsp;</font></font><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\">skład powietrza,&nbsp;ruch powietrza,&nbsp;kolor, smak i zapach powietrza.<b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\"><br>Część III-&nbsp;</b></font></font><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\">Prezentacja zestawu demonstrującego działanie energii odnawialnych (m. in. wiatru).</font></font><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\"><b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\"><br>Część IV</b></font></font><font face=\"Times New Roman, serif\" style=\"color: rgb(68, 68, 68); font-size: 12.8013px;\"><font size=\"3\">- Tworzenie rysunków obrazujących źródła zanieczyszczeń powietrza oraz obrazków nawiązujących do sposobów zapobiegania temu zjawisku.<font face=\"Times New Roman, serif\"><b style=\"margin: 0px; padding: 0px; border: 0px; outline: 0px; vertical-align: baseline; background: transparent; font-weight: bold;\"><br>Część V</b>- Podsumowanie zajęć- Quiz</font></font></font><br></p>', '2021/02/12 23:47', 'Małopolska w zdrowej atmosferze', 56, 10);
